Mi vestido de novia ha sido un amuleto de la buena suerte para @AdanTerriquezOficial ❤️ en un nuevo episodio en mi Podcast Ana Patricia Sin Filtro Adan y yo platicamos de cómo fue ser el diseñador personal de Jenny Rivera por muchos años, también me contó con qué artista no le gustaría volver a trabajar y cómo para Él y su negocio la pandemia fue una etapa muy difícil, platicamos de eso y muchas cosas! Pueden escucharlo en el link de mi BIO o en cualquier plataforma de Podcast 
